import React, {Component} from 'react'


class Article extends Component {
    render() {
        const {article} = this.props;
        const body  = <section>Bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla-bla</section>
        return (
            <div>
                <h2>
                    title <br />
                    <button onClick={handleClick}>Clicked</button>
                </h2>
                {body}
                <h3>creation date: {(new Date()).toTimeString()}</h3>
            </div>
        )
    }

}



function handleClick() {
    console.log('Button clicked');
}


export default Article;
